import axios from "axios";

//map
//from,to text fields
//search button

//farecomparision button
//farecomparision page

function HomePage() {
    const next = useNavigate();
    const GitApi = () => {
        const [users, setUsers] = useState([])
        const getUsers= async()=>{
            try {
                const res = await axios.get("https://api.github.com/users");
               setUsers(res.data)
       
            } catch (error) {
                console.log("error.message")
            }
    
        }
    }
    return <div>Home
        <button onClick={() => { next("/listing") }}>listingpage</button>

        <div id="map"></div>
    <label htmlFor="start">Start: </label>
    <input type="text" id="start" value="Chicago, IL"/>
    <br/>
    <label htmlFor="end">End: </label>
    <input type="text" id="end" value="Los Angeles, CA"/>
    <br/>
    <button id="submitBtn" onClick={() => { next("/listing") }}>Search</button>

    </div>

}

export default HomePage;
